import React, { useState } from 'react'
import styled from 'styled-components'

const Check = styled.image`
  width: 24px;
  height: 24px;
  margin-left: 20px;
  margin-right: 20px;
`

const Text = styled.text`
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 400;
  font-size: 16px;
  line-height: 24px;
`
interface MemberBoxProps {
  clickedAccountList: Array<string>
  account_id: string
  birth_date: string
  gender: string
  name: string
  phone_number: string
  onClickMemberBox: (account_id: string) => void
}

export const MemberBox = (props: MemberBoxProps) => {
  const {
    clickedAccountList,
    account_id,
    birth_date,
    gender,
    name,
    phone_number,
    onClickMemberBox,
  } = props
  const [clicked, setClicked] = useState(
    clickedAccountList.indexOf(account_id) > -1 ? true : false
  )
  console.log(clickedAccountList)
  return (
    <div
      style={{
        background: clicked ? '#F0F1F3' : '#ffffff',
        display: 'flex',
        width: '100%',
        marginTop: '8px',
        height: '56px',
        alignItems: 'center',
      }}
      onClick={() => onClickMemberBox(account_id)}
    >
      <Check>
        <img
          src={clicked ? '/source/icon/check.svg' : '/source/icon/no_check.svg'}
          alt=""
        />
      </Check>
      <Text>{name}</Text>
      <Text>{gender}</Text>
      <Text>{birth_date}</Text>
      <Text>{phone_number}</Text>
    </div>
  )
}
